import React from "react";
import logo from "./logo.svg";
import "./App.css";
import { getUsers } from "./actions";

async function App() {
  let users = await this.props.getUsers();
  return (
    <div className="App">
      <div className="app-title">Pizza App :D</div>

      <h2>{console.log("users", users)}</h2>
    </div>
  );
}

export default App;
